import React from "react";
import Header from "../components/Header";
import SearchBar from "../components/SearchBar";
import ResultsContainer from "../components/ResultsContainer";

function Search() {
  return (
    <>
      <Header />
      <SearchBar />
      <ResultsContainer />
    </>
  );
}

export default Search;
